import React, { Component } from 'react';
import { RadioGroup } from 'react-materialize';

export default class Datepicker extends Component {
  render() {
    return (
      <div>
        <RadioGroup
          name="size"
          label="T-Shirt Size"
          onChange='xl'
          options={[{label: 'XL',value: 'xl'},{label: 'L',value: 'l'},{label: 'M',value: 'm'}]}
        />
      </div>
    )
  }
}
